-- Structure for view `view_inquirytrxmodel`
--
DROP TABLE IF EXISTS `view_inquirytrxmodel`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_inquirytrxmodel`  AS  select `BX`.`inquirytype_id` AS `inquirytype_id`,`AX`.`trxmodel_id` AS `trxmodel_id`,`AX`.`trxmodel_name` AS `trxmodel_name`,`AX`.`trxmodel_descr` AS `trxmodel_descr`,`AX`.`trxmodel_isdateinterval` AS `trxmodel_isdateinterval`,`AX`.`trxmodel_formtitle_id` AS `trxmodel_formtitle_id`,`AX`.`trxmodel_formtitle_en` AS `trxmodel_formtitle_en`,`AX`.`taxtype_id` AS `taxtype_id`,`AX`.`_createby` AS `_createby`,`AX`.`_createdate` AS `_createdate`,`AX`.`_modifyby` AS `_modifyby`,`AX`.`_modifydate` AS `_modifydate` from (`mst_trxmodel` `AX` join (select distinct `A`.`inquirytype_id` AS `inquirytype_id`,`A`.`trxmodel_id` AS `trxmodel_id` from (select `mst_inquirytype`.`inquirytype_id` AS `inquirytype_id`,`mst_inquirytype`.`trxmodel_id` AS `trxmodel_id` from `mst_inquirytype` union select `mst_inquirytypetrxmodel`.`inquirytype_id` AS `inquirytype_id`,`mst_inquirytypetrxmodel`.`trxmodel_id` AS `trxmodel_id` from `mst_inquirytypetrxmodel`) `A`) `BX` on(`BX`.`trxmodel_id` = `AX`.`trxmodel_id`)) ;

