--
-- Structure for view `view_userdept`
--
DROP TABLE IF EXISTS `view_userdept`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_userdept`  AS  select distinct `AX`.`empl_id` AS `empl_id`,`AX`.`dept_id` AS `dept_id`,`BX`.`dept_name` AS `dept_name` from ((select `mst_empl`.`empl_id` AS `empl_id`,`mst_empl`.`dept_id` AS `dept_id` from `mst_empl` union select `mst_empldept`.`empl_id` AS `empl_id`,`mst_empldept`.`dept_id` AS `dept_id` from `mst_empldept` union select `A`.`empl_id` AS `empl_id`,`B`.`dept_id` AS `dept_id` from (`mst_empluser` `A` join `mst_dept` `B`) where `A`.`empluser_allowviewalldept` = 1) `AX` join `mst_dept` `BX` on(`BX`.`dept_id` = `AX`.`dept_id`)) where `BX`.`dept_isdisabled` = 0 ;

